import React, { Fragment } from "react";

function Navigation() {
  return (
    <Fragment>
      <nav>
        <a href="#">Menu</a>
        <a href="#">Party Platters</a>
        <a href="#">Locations</a>
        <a href="#">Rewards</a>
        <a href="#">Reservations</a>
      </nav>
    </Fragment>
  );
}

export default Navigation;
